def median(values):

    if len(values) == 0:
        return None
    values.sort()
    if len(values) % 2 == 0:
        position = int(len(values) / 2)
        a = values[position - 1]
        b = values[position]
        return (a + b) / 2
    else:
        position = int((len(values) / 2) - 0.5)
        return values[position]

