                x *= 3
            elif x > n:
                if x < bestfac:
                    bestfac = x
                if x & 1:
                    break
                x >>= 1
            else:
                return n
        f5 *= 5
    return bestfac

def five_by_five_shape(n):

    if n // 5 == 0:
        return (1, n % 5)
    elif n % 5 > 0:
        return ((n // 5) + 1, 5)
    else:
        return (n // 5, 5)

def clog2(num):

    if num < 1:
        raise ValueError("expected num >= 1")
    accum, shifter = 0, 1
    while num > shifter:
        shifter <<= 1
        accum += 1
    return accum

