def close(x, y, rtol, atol):

    # assumes finite weights
    return abs(x-y) <= atol + rtol * abs(y)

def sort_standard_chrs(chrom):

    chrom = chrom[3:]
    if chrom.isdigit():
        return int(chrom)
    if chrom == 'X':
        return 23
    elif chrom == 'Y':
        return 24
    elif chrom == 'M':
        return 25
    else:  # unknown chr
        return 26

def to_nom_val_and_std_dev(interval):

    lwr_bnd, upr_bnd = interval
    sigma = (upr_bnd - lwr_bnd)/2
    mu = lwr_bnd + sigma
    return (mu, sigma)

