def build_falloff(parameters, falloff_function):

    if falloff_function == 'Troe':
        falloff_string = ('Troe(' +
                          f'A = {parameters[0]}' +
                          f', T3 = {parameters[1]}' +
                          f', T1 = {parameters[2]}' +
                          f', T2 = {parameters[3]})'
                          )
    elif falloff_function == 'SRI':
        falloff_string = ('SRI(' + 
                          f'A = {parameters[0]}' +
                          f', B = {parameters[1]}' +
                          f', C = {parameters[2]}' +
                          f', D = {parameters[3]}' +
                          f', E = {parameters[4]})'
                          )
    else:
        raise NotImplementedError(f'Falloff function not supported: {falloff_function}')

    return falloff_string

